import React from "react";

class FormSearch extends React.Component {

    constructor(props) {
        super(props);
    }

    handleSubmit(e) {
        console.log('filtr is submited');
    }

    render() {
        return (
            <div>
                <form>
                    <input type="text" name="city"
                           placeholder="Фильтр"
                           onChange={(e) => {
                               handleSubmit(e)
                           }}/>
                    <button onClick={(e, filtr) => {
                        this.props.listOfNotes(e, e.target.value)
                    }}>Список заметок
                    </button>
                </form>
            </div>
        );
    }
}

export default FormSearch;
